<?php

namespace App\Http\Controllers\Voucher;

use App\Http\Controllers\Controller;
use Illuminate\Http\Request;
use Illuminate\Support\Facades\DB;

class ShopRackBillCollectionVoucherController extends Controller
{

  public function voucherInfo($voucher_no){
    $voucher_info_sql = "SELECT s.name as shop_name,au.name as agent_name,c.rack_code,c.shoks_bill_no, c.quantity, c.total_amount,c.shop_commission_percentage,c.shop_commission_amount,c.agent_commission_amount,c.agent_commission_percentage FROM `commissions` c 
    LEFT JOIN shops s on c.shop_id = s.id
    LEFT JOIN agent_users au on c.agent_id = au.id
    WHERE c.shoks_bill_no = '$voucher_no'";
    $voucher_info = DB::select(DB::raw($voucher_info_sql));
    $data = [
      "voucher_info" => $voucher_info[0]
    ];
    return view('agent.rack.bill-collection.voucher-info', $data);
  }

    public function voucherShow($voucher_no){
        $mpdf = new \Mpdf\Mpdf([
            'default_font_size'=>10,
            'default_font'=>'nikosh'
        ]);

        $mpdf->WriteHTML($this->pdfHTML($voucher_no));
        $mpdf->Output();
    }



    public function pdfHTML($voucher_no){
        $rack_info = DB::table('shock_bills as sb')
                    ->select([
                        'sb.entry_datetime',
                        's.name  as shop_name',
                        's.area  as shop_area',
                        's.market_name' ,
                        'sb.rack_code' ,
                        'au.name  as agent_name'
                    ])
                    ->leftJoin('shops as s', 'sb.shop_id', 's.id')
                    ->leftJoin('agent_users as au', 'sb.shop_id', 'au.id')
                    ->where('sb.shocks_bill_no', $voucher_no)
                    ->first();
            $entry_datetime = date('jS,F Y h:i a', strtotime($rack_info->entry_datetime));
            $shop_name      = $rack_info->shop_name;
            $shop_area      = $rack_info->shop_area;
            $market_name    = $rack_info->market_name;
            $rack_code      = $rack_info->rack_code;
            $agent_name     = $rack_info->agent_name;


            $sql = "SELECT b.*,
            c.shop_commission_percentage,
           c.agent_commission_percentage 
           FROM (SELECT
           t.types_name,
           bill.*   
        FROM
           (
              select
                 rp.type_id,
                 count(*) as unit,
                 rp.selling_price,
                 sum(rp.selling_price) as total_price,
                 sb.shocks_bill_no 
              from
                 shock_bills sb 
                 left join
                    rack_products rp 
                    on sb.shocks_bill_no = rp.shocks_bill_no 
              where
              sb.shocks_bill_no ='$voucher_no'
              group by
                 rp.type_id 
           )
           bill 
           left join
              types t 
              on bill.type_id = t.id) b
              LEFT JOIN commissions c on  b.shocks_bill_no = c.shoks_bill_no GROUP by b.type_id";
              
            $datas = DB::select(DB::raw($sql));
            $socks_info = '';
            $sl = 0;
            $total = 0;
            $total_shop_commission = 0;
            $total_unit = 0;
            foreach($datas as $data){
                
                $sl++;

                $shop_commission        = ($data->total_price/100) * $data->shop_commission_percentage ;
                $total                 += $data->total_price;
                $total_unit            += $data->unit;
                $total_shop_commission += $shop_commission;
                $unit_price             = number_format($data->selling_price,2);
                $total_price            = number_format($data->total_price,2);
                $shop_commission        = number_format($shop_commission,2);

                $socks_info .= "<tr>
                    <td>$sl</td>
                    <td>$data->types_name</td>                    
                    <td> $unit_price /=</td>
                    <td>$data->unit Pair</td>
                    <td>$total_price</td>
                    <td>$shop_commission</td>                
                </tr>";
            }
            $shopkeeper_give       = number_format(($total - $total_shop_commission),2);
            $total                 = number_format($total, 2);
            $total_shop_commission = number_format($total_shop_commission, 2);
           

            $socks_info .= "<tr>
                    <td colspan='3'>Total / সর্বোমোট = </td>
                    <td>$total_unit Pair</td>
                    <td>$total</td>
                    <td>$total_shop_commission</td>                
                </tr>";

            $output         = "<html>
      <style type='text/css'>

          table, td, th {     
            border: 1px solid black;
            text-align: left;
          }

      table {
        border-collapse: collapse;
        width: 100%;
      }

      th, td {
        padding: 5px;
        font-size: 12px;
      }

     
     

     


  </style>

          <img
           src='data:image/png;base64,'
        />

        <h2 style='text-align:center;'>আলনার  বিল ভাউচার</h2>
          <table>


      <tr>
      <td>তারিখ /  Date <span style='color:red;'>*</span></td>
      <td>$entry_datetime</td> 
       </tr>

    <tr>
       <td>দোকানের নাম /  Shop name <span style='color:red;'>*</span></td>
       <td>$shop_name</td> 
    </tr>

   
    <tr>
       <td>এলাকা / Area <span style='color:red;'>*</span></td>
       <td>$shop_area</td> 
    </tr>


     <tr>
       <td>মার্কেটের নাম / Market Name <span style='color:red;'>*</span></td>
       <td>$market_name</td> 
    </tr>



     <tr>
       <td>আলনা কোড  / Rack Code. <span style='color:red;'>*</span></td>
       <td>$rack_code</td> 
    </tr>


    <tr>
       <td>এজেন্ট নাম  / Agent Name. <span style='color:red;'>*</span></td>
       <td>$agent_name</td> 
    </tr>

</table>

<h4>  পণ্যের বিবরন  / Product Information</h4>


<table>
    <tr>
        <td>ক্রমিক নং </td>
        <td>পণ্যের ধরন </td>        
        <td>প্রতি জোড়ার দাম / Unit Price</td>
        <td> একক / Unit</td>
        <td>সর্বমোট /  Total</td>
        <td>দোকানদারের কমিশন  /  Shop Commission</td>
       
    </tr>

    $socks_info
    

   
</table>

<br>
<p>$total_unit জোড়া  মোজা , সর্বমোট $total টাকা , দোকানদারের কমিশন $total_shop_commission টাকা , দোকানদার দিবে $shopkeeper_give টাকা </p>   
<br>
